import React from "react";

function TodoItem(props) {
  console.log(props);
  function removeTask(id) {
    props.deleteItem(id);
  }
  return (
    <div>
      <li>{props.todo}</li>
      <button
        onClick={() => {
          removeTask(props.id);
        }}
      >
        Delete
      </button>
    </div>
  );
}

export default TodoItem;
